import React from 'react';

const Postitem = () => {
    return (
        <div className="post">
            <div className="post__content">
                <strong> 1. Javascript</strong>
                <div>
                    Javascript - мова програмування
          </div>
            </div>
            <div className="post__btns">
                <button>Видалити</button>
            </div>
        </div>
    )
}

export default Postitem;
